    data: |
      SELECT DISTINCT 45 + - col1 + + + ( + col0 ) * + col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 IS NULL;
  - name: tab2

outputs:
  - name: q3249.out
    data: |
      2340
      4896
      5003
